import React from 'react';
import Home from './Home';
import About from './About';
import Service from './Service';
import Contact from './Contact';
import { Route } from 'react-router-dom';

const App = () => {
  return (
    <>
      <Route exact path="/" component={Home}></Route>
    </>
  );
}

export default App;
